import Navbar from './Components/Navbar.js';
import '../src/index.css';
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';

  function App() {
    const responsive = {
      superLargeDesktop: {
        // the naming can be any, depends on you.
        breakpoint: { max: 4000, min: 3000 },
        items: 5
      },
      desktop: {
        breakpoint: { max: 3000, min: 1024 },
        items: 3
      },
      tablet: {
        breakpoint: { max: 1024, min: 464 },
        items: 2
      },
      mobile: {
        breakpoint: { max: 464, min: 0 },
        items: 1
      }
    };
  return (
    <div class="Centerr">
    <Navbar/> <h1>Sample Flowers</h1>
    <Carousel responsive={responsive}>
  <div class="card">
    <img src="https://images.unsplash.com/photo-1578439231583-9eca0a363860?q=80&w=1000&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8cmVkJTIwcm9zZXN8ZW58MHx8MHx8fDA%3D" alt="red flowers" />
  </div>
  <div>Item 2</div>
  <div>Item 3</div>
  <div>Item 4</div>
</Carousel>
